import React from 'react'
import styles from './Team.module.css'
import Teamcard from '../../Components/TeamCard/Teamcard'
const data = [
  {
    "name":"Aryan Tiwari",
    "role":"Web-Lead"
  },
  {
    "name":"Aryan Tiwari",
    "role":"Web-Lead"
  },
  {
    "name":"Aryan Tiwari",
    "role":"Web-Lead"
  },
  {
    "name":"Aryan Tiwari",
    "role":"Web-Lead"
  },
  {
    "name":"Aryan Tiwari",
    "role":"Web-Lead"
  }
]

const Team = () => {
  return (
    <div>
     <h1>Our Team</h1>

   {data.map((e)=><Teamcard name={e.name} role={e.role}/>)}
   </ div>
  )
}

export default Team
